import './App.css';
import { useState} from "react";

function App() {
  const [ input, setInput ] = useState("");
  const [ output, setOuput ] = useState("");
  return (
    <div className="App">
      <input 
        type="text" 
        value={input}
        onChange={e=> setInput(e.target.value)}
        onKeyDown={e=>{
          if (e.key === "enter"){
            setOuput("output")
          }
        }}

      />
      <div className="terminal">
        {output}
      </div>
    </div>
  );
}

export default App;
